function WMP_THEMES_GALLERY(){this.type="wmp_themes",this.DOMDoc,this.init=function(){WMPJSInterface=window.parent.WMPJSInterface,this.initThemesPreview(),this.initThemesGalleries()},this.initThemesGalleries=function(){jQuery("."+this.type+"_preview[data-snapshots]").each(function(a,b){var c=jQuery(b).attr("data-snapshots").split(",");if(c.length>0){var d=c.map(function(a){var b={};return b.src=a,b});jQuery(b).magnificPopup({items:d,gallery:{enabled:!0},type:"image"})}})},this.initThemesPreview=function(){jQuery("."+this.type+"_preview[data-url]").click(function(){window.open(jQuery(this).attr("data-url"),"previewApp","location=yes,width=375,height=667")})}}
